import React, { useState } from 'react';

export const ListeEnchere = () => {

    const login = (event) => {
        window.location.replace('/demanderechargement');
    }

    return (
        <form onSubmit={login}>
            <button type="submit">Se connecter</button>
        </form>
    );

}

export default ListeEnchere;
